import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">  
      <Navbar bg="light" expand="lg">
      <Navbar.Collapse id="basic-navbar-nav">
        <Navbar.Brand href="#home">Gretchen Krammes</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#portfolio">Portfolio</Nav.Link>
          <Nav.Link href="#contact">Contact</Nav.Link>
        </Nav>
        </Navbar.Collapse>
      </Navbar>
        <p>
        Full stack web developer leveraging experience in sales and customer service to build a better and more responsive user experience. Recently earned a professional certificate in full stack coding from Butler University, with recently developed skills in React, JavaScript, Css, and website responsiveness. Interested in expanding knowledge and experience to grow into a successful career in UX/UI design.
        </p>      
    </div>
  );
}

export default App;
